import React from 'react';
import logo from './logo.svg';
import './App.css';
import Menu from './components/menu';
import { PLACES } from './shared/places';
import {BrowserRouter as Router,Route, Link,} from "react-router-dom";
import 'bootstrap/dist/css/bootstrap.min.css';
import { Navbar, Nav} from 'mdbreact';
import { NavDropdown, Button, Form, FormControl, ControlLabel } from "react-bootstrap";

class MyNavbar extends React.Component {

  render() {
    return(
        <nav>
        <ul class="nav">
        <li><a href="#">Home</a></li>
        <li><a href="#">Dinosaurs</a></li>
        <li><a href="#">Pterosaurs</a></li>
        <li><a href="#">Plesiosaurs</a></li>
        <li><a href="#">Mammals</a></li>
        </ul>
        </nav>
  )
  }
}

class App extends React.Component {					

	constructor(props){
		super(props);

		this.state = {
			places: PLACES
		};
	}

	render(){
		return (
			<div className='App'>
        <MyNavbar/>
				<h1>Upcoming Events</h1>
				<Menu places={this.state.places} />

			</div>
		);
	}
}

export default App;
